import "./AdminPanel.css"

export const AdminPanel = () => {
  return (
    <div>
      <table className="administrator-table">
        <tr>
          <th>Ячейка 1</th>
          <th>Ячейка 2</th>
        </tr>
        <tr>
          <td>Ячейка 3</td>
          <td>Ячейка 4</td>
        </tr>
      </table>
    </div>
  );
};
